int main(int argc,char *argv[])
{
  try
  {

    glsCommandLine::Instance()->ReadCommandLine(argc,argv);

    gLStudio_Adi = new GLStudio_AdiClass("GLStudio-Adi",759,759);
    gLStudio_Adi->CreateObjects();

//////////////////// User Code from section: "Main Initialization" ////////////
///////////////////////////////////////////////////////////////////////////////
    gLStudio_Adi->SetRedraw();

    Timer frameTimer;
    do
    {
//////////////////// User Code from section: "Main Loop" //////////////////////
///////////////////////////////////////////////////////////////////////////////
        gLStudio_Adi->RecordCalculateStart();
        gLStudio_Adi->Calculate(frameTimer.ElapsedSecondsDouble());
        gLStudio_Adi->RecordCalculateEnd();
        gLStudio_Adi->SetRedraw();
    }
    while(Fl::check() > 0);

    // Delete the instance
    delete gLStudio_Adi;

  }
  catch(DistiException e)
  {
    Error(e.what());
  }
  return 0;
}
